import seachicon from "../img/seachicon.svg";
import likeDel from "../img/likeDel.svg";

export default function Like({ like }) {
  return (
    <div className="like_page">
      <div className="like_head_box">
        <h2>Your Like</h2>
        <div className="like_search_box">
          <input placeholder="Name"></input>
          <div>
            <img src={seachicon}></img>
          </div>
        </div>
      </div>
      <div className="like_head_line"></div>
      {like.map((res) => {
        return (
          <>
            <span>{res.length} pokemon</span>

            <ul className="like_content">
              {like.map((res) => {
                return (
                  <li>
                    <div className="like_content_img"></div>
                    <div className="like_content_info">
                      <ul className="like_content_infoTop">
                        <li>
                          <h3>{res.name}</h3>
                          <span>type</span>
                          <span>type2</span>
                        </li>
                        <li>
                          <span>Height: 25cm</span>
                          <span>Weight: 15kg</span>
                        </li>

                        <li>01</li>
                      </ul>
                      <ul className="like_content_infoBottom">
                        <li>
                          <span>pokemon encyclopedia</span>
                        </li>
                        <li>
                          <img src={likeDel} />
                        </li>
                      </ul>
                    </div>
                  </li>
                );
              })}
            </ul>
          </>
        );
      })}
    </div>
  );
}
